import React from 'react';
import { useNavigate } from 'react-router-dom';
import { Carousel, Button } from 'antd';
import { PlusOutlined, EditOutlined } from '@ant-design/icons';

const Welcome = () => {
  const navigate = useNavigate();

  const handleAddProperty = () => {
    navigate('/property-input');
  };

  const handleEditProperty = () => {
    navigate('/property-edit');
  };

  return (
    <div style={{ textAlign: 'center', padding: '50px' }}>
      <Carousel autoplay autoplaySpeed={7000}>
        <div style={{ position: 'relative', textAlign: 'center' }}>
          <img
            src="https://i.pinimg.com/736x/8f/c8/e7/8fc8e7a1856b188288f255d92148c9e9.jpg"
            alt="Hoşgeldin"
            style={{ width: '100%', height: '400px', objectFit: 'cover' }}
          />
          <h3 style={{ 
            position: 'absolute', 
            top: '50%', 
            left: '50%', 
            transform: 'translate(-50%, -50%)', 
            color: 'white', 
            backgroundColor: 'rgba(0, 0, 0, 0.5)', 
            padding: '10px' 
          }}>Hoşgeldin</h3>
        </div>
        <div style={{ position: 'relative', textAlign: 'center' }}>
          <img
            src="https://i.pinimg.com/736x/c5/6c/69/c56c6911d83ee6b1cd724539b2a4efb5.jpg"
            alt="Ev Ekleyebilirsin"
            style={{ width: '100%', height: '400px', objectFit: 'cover' }}
          />
          <h3 style={{ 
            position: 'absolute', 
            top: '50%', 
            left: '50%', 
            transform: 'translate(-50%, -50%)', 
            color: 'white', 
            backgroundColor: 'rgba(0, 0, 0, 0.5)', 
            padding: '10px' 
          }}>Ev Ekleyebilirsin</h3>
        </div>
        <div style={{ position: 'relative', textAlign: 'center' }}>
          <img
            src="https://i.pinimg.com/564x/39/45/76/39457698ee28bfd546dcc15dcb32778a.jpg"
            alt="Düzenleme Yapabilirsin"
            style={{ width: '100%', height: '400px', objectFit: 'cover' }}
          />
          <h3 style={{ 
            position: 'absolute', 
            top: '50%', 
            left: '50%', 
            transform: 'translate(-50%, -50%)', 
            color: 'white', 
            backgroundColor: 'rgba(0, 0, 0, 0.5)', 
            padding: '10px' 
          }}>Düzenleme Yapabilirsin</h3>
        </div>
      </Carousel>
      <Button type="primary" icon={<PlusOutlined />} onClick={handleAddProperty} style={{ marginTop: '20px', marginRight: '10px' }}>
        Ev Ekle
      </Button>
      <Button type="default" icon={<EditOutlined />} onClick={handleEditProperty} style={{ marginTop: '20px' }}>
        Ev Düzenle
      </Button>
    </div>
  );
};

export default Welcome;
